function cloneObject(obj, src) {
    if(!obj) {
    	obj = {}
    }
    for(var i in src) {
        if(typeof(src[i])=="object" && src[i] != null)
            obj[i] = cloneObject(obj[i], src[i]);
        else
            obj[i] = src[i];
    }
    return obj;
}



